Gwirionedd y Galon: Dr John Davies

Biography Documentary hosted by Dylan Richards, published by S4C in 2013 - English narration


Information
------------------------------

Dr John Davies is one of our nation's most notable historians and the author of the definitive work on Welsh history 'History of Wales&quot;. This year he celebrates his 75th birthday and in the programme we follow him for six days in Grangetown, Cardiff, Treorchy in the Rhondda and at his cottage in rural Ceredigion.
Produced by Telesgop.

